import React, { useState } from 'react';

const FbiPersonDetailsModal = ({ person }) => {
  const [show, setShow] = useState(false);

  const handleClose = () => setShow(false);
  const handleShow = () => setShow(true);

  return (
    <>
      <Button variant="primary" onClick={handleShow}>
        See details
      </Button>

      <Modal show={show} onHide={handleClose}>
        <Modal.Header closeButton>
          <Modal.Title>FBI Person Details</Modal.Title>
        </Modal.Header>
        <Modal.Body>
          <p><strong>Title:</strong> {person.title}</p>
          <p><strong>Locations:</strong> {person.locations || 'N/A'}</p>
          <p><strong>Sex:</strong> {person.sex || 'N/A'}</p>
          <p><strong>Nationality:</strong> {person.nationality || 'N/A'}</p>
          <p><strong>Age (Min):</strong> {person.age_Min || 'N/A'}</p>
          <p><strong>Age (Max):</strong> {person.age_Max || 'N/A'}</p>
          <p><strong>Subjects:</strong> {person.subjects || 'N/A'}</p>
          <p><strong>Race:</strong> {person.race || 'N/A'}</p>
          <p><strong>Place of Birth:</strong> {person.place_Of_Birth || 'N/A'}</p>
          {/* Adicione outros campos de detalhes aqui conforme necessário */}
        </Modal.Body>
        <Modal.Footer>
          <Button variant="secondary" onClick={handleClose}>
            Close
          </Button>
          {/* Adicione a lógica para buscar mais detalhes da API aqui */}
          <Button variant="primary" href={person.url} target="_blank">
            View More Details
          </Button>
        </Modal.Footer>
      </Modal>
    </>
  );
};

export default FbiPersonDetailsModal;
